import React from 'react'
import { useState } from 'react'
const Navbar = () => {
    const [active, setActive] = useState(false)

    const navbarActive = () => {
        setActive(!active)
        console.log(active)
    }

    return (
        <nav data-aos="fade-up" className="navbar">
            <div className="nav-links">
                <a href="#">About me</a>
                <a href="#">Projects</a>
                <a href="#">Skills</a>
                <a href="#">Contact me</a>
                <a href="#">Timeline</a> 
            </div>
            <div className='active-nav'>
                <a href="#">Juan's Portfolio</a>
                <a onClick={navbarActive}></a>
            </div>

        </nav>
    )
}

export default Navbar;
